import { VFC } from 'react';
import Header from 'component/header/header';
import RecordEntryForm from 'component/form/recordEntryForm';

const App: VFC = () =>{
    return(
        <>
            <Header></Header>
            <RecordEntryForm></RecordEntryForm>
        </>
    )
}

const StyledWrapper =styled.div`
width: 30%;
margin: 0 auto;
height: 150px;
align-items: center;
justify-content: center;
display: flex;
`;

export default App;
